// Helper function to parse Excel date codes and custom formats
function parseFlexibleDate(value) {
  if (!value) return null;

  // Excel numeric date
  if (typeof value === 'number') {
    const base = new Date(Date.UTC(1899, 11, 30));
    return new Date(base.getTime() + value * 86400000);
  }

  // Format: MM/DD/YYYY at HH:MM AM/PM
  if (typeof value === 'string') {
    const match = value.match(/^(\d{1,2})\/(\d{1,2})\/(\d{4})\s+at\s+(\d{1,2}):(\d{2})\s+(AM|PM)$/i);
    if (match) {
      let [, month, day, year, hour, minute, ampm] = match;
      month = parseInt(month, 10) - 1;
      day = parseInt(day, 10);
      year = parseInt(year, 10);
      hour = parseInt(hour, 10);
      minute = parseInt(minute, 10);

      if (ampm.toUpperCase() === 'PM' && hour < 12) hour += 12;
      if (ampm.toUpperCase() === 'AM' && hour === 12) hour = 0;

      return new Date(year, month, day, hour, minute);
    }

    const fallback = Date.parse(value);
    if (!isNaN(fallback)) return new Date(fallback);
  }

  return null;
}

// Process the input
let allItems = $input.all();
let rows = Array.isArray(allItems[0].json) ? allItems[0].json : allItems.map(i => i.json);
const guestCardMap = {};

rows.forEach(row => {
  const propertyId = String(row["Property ID"]).trim();
  if (!propertyId || String(row["Status"] || "").toLowerCase() === "inactive") return;

  if (!guestCardMap[propertyId]) {
    guestCardMap[propertyId] = {
      total: 0,
      active: 0,
      applicationCompleted: 0,
      latestDate: null
    };
  }

  const status = String(row["Status"] || "").toLowerCase();
  if (["active", "application completed"].includes(status)) {
    guestCardMap[propertyId][status === "active" ? "active" : "applicationCompleted"] += 1;
    guestCardMap[propertyId].total += 1;
  }

  const interestRaw = row["Interest Received"];
  const parsed = parseFlexibleDate(interestRaw);
  if (parsed && (!guestCardMap[propertyId].latestDate || parsed > guestCardMap[propertyId].latestDate)) {
    guestCardMap[propertyId].latestDate = parsed;
  }
});

// Return properly formatted output
return Object.keys(guestCardMap).map(propertyId => {
  const data = guestCardMap[propertyId];
  return {
    json: {
      "Property ID": propertyId,
      "Total Guest Cards (Active + Completed)": data.total,
      "Active": data.active,
      "Application Completed": data.applicationCompleted,
      "Latest Interest Received": data.latestDate ? data.latestDate.toISOString() : null
    }
  };
});
